import { withStyles } from "@material-ui/core/styles";

export default withStyles(theme => {
  const { colors } = theme.palette;

  return {
    container: {
      width: "75%",
      height: "75%"
    },
    socialLinkContainer: {
      position: "absolute",
      bottom: 0,
      left: 40
    },
    number: {
      color: colors.secondary
    },
    pageTitle: {
      color: colors.white,
      marginLeft: 10
    },
    line: {
      display: "inline"
    },
    para: {
      fontSize: "16px",
      color: colors.main50,
      marginTop: 20
    },
    imgContainer: {
      display: "flex",
      justifyContent: "center"
    },
    img: {
      width: "70%",
      height: "100%"
    }
  };
});
